import "./UserContainer.css";
import UserCard from "../UserCard";

const UserConainer = ({ users }) => {
  return (
    <div className="user-container">
      {users.map((user) => (
        <UserCard userInfo={user} />
      ))}
    </div>
  );
};

export default UserConainer;
